import { ShoppingCartOutlined } from "@ant-design/icons";
import { Link } from "react-router-dom";

const Cart = () => {
    return (
      <div className="cart">
        <Link to="/cart">Đăng kí</Link>
        <ShoppingCartOutlined />
        Giỏ hàng
      </div>
    );
}

export default Cart;
